 DROP DATABASE IF EXISTS travelwebsite;

CREATE DATABASE travelwebsite DEFAULT char
SET
    utf8mb4 COLLATE utf8mb4_general_ci;

USE travelwebsite;

CREATE TABLE travelwebsite.user (
    `user_id` INT NOT NULL AUTO_INCREMENT,
    `is_email_verified` boolean not null default(0),
    `role` VARCHAR(64) NOT NULL DEFAULT ('member') CHECK(role IN('member', 'moderator', 'admin')),
    `first_name` VARCHAR(50) NULL,
    `last_name` VARCHAR(50) NULL,
    `username` VARCHAR(100) NULL,
    `email` VARCHAR(100) NULL,
    `password` VARCHAR(50) NULL,
    `password_hash` VARCHAR(70) NULL,
    `city` VARCHAR(50) NULL,
    `state` VARCHAR(50) NULL,
    `country` VARCHAR(50) NULL,
    `registration_time` datetime NULL,
    `last_login_time` DATETIME NULL,
    UNIQUE (`username`),
    UNIQUE (`email`),
    PRIMARY KEY (`user_id`)
);

CREATE TABLE travelwebsite.place (
    `place_id` INT NOT NULL AUTO_INCREMENT,
    `title` VARCHAR(70) NOT NULL,
    `category` VARCHAR(20) NOT NULL,
    `city` VARCHAR(50) NOT NULL,
    `state` VARCHAR(20) NULL,
    `country` VARCHAR(50) NOT NULL,
    `image` VARCHAR(100) NULL,
    PRIMARY KEY (`place_id`)
);

CREATE FULLTEXT INDEX place_fulltext ON travelwebsite.place(`title`, `category`, `city`);

CREATE TABLE travelwebsite.review (
    `review_id` INT NOT NULL AUTO_INCREMENT,
    `user_id` INT NOT NULL,
    `place_id` INT NOT NULL,
    `title` VARCHAR(100) NOT NULL,
    `review_text` TEXT NOT NULL,
    PRIMARY KEY (`review_id`),
    FOREIGN KEY (`user_id`) REFERENCES travelwebsite.user (`user_id`) ON DELETE CASCADE,
    FOREIGN KEY (`place_id`) REFERENCES travelwebsite.place (`place_id`) ON DELETE CASCADE
);

CREATE FULLTEXT INDEX review_review_text ON travelwebsite.review(`review_text`, `title`);





